import React from "react";
import { useState } from "react";
import axios from "axios";

function main(){
    var all='2'
    var v="asdf"
    const getAll=()=>{

            axios.get("http://localhost:8080/login", {
            }).then((res) => {

                console.log(res)
                const all=res.data[0].account
                alert(all)
               console.log(all)

            }).catch(function (error) {
                // handle error
                console.log(error);
            })

    }

    return(
        <div>
            {getAll()}
            <div>
                {all}
                {v}
            </div>
        </div>

    )
}
export default main;
